import Link from 'next/link';

const Nav = () => (
    <div className='my-nav'>
        <Link href='/'><a>Home Page</a></Link>
        <Link href='/about'><a>About Page</a></Link>
        <Link href='/news'><a>News</a></Link>
    </div>
);

export default Nav;
